import React from 'react';
import { useDispatch } from 'react-redux';
import { getAnnimeAsync } from '../ducks/anime/slice';
import Button from '../component/Button';

const Page: React.FC = () => {
	const dispatch = useDispatch();
	const onClickGetAnnime = () => {
		dispatch(getAnnimeAsync(2020, 1));
	};

	return (
		<>
			<button type="button" onClick={onClickGetAnnime}>
				アニメ
			</button>
			<div onLoad={() => dispatch(getAnnimeAsync(2020, 1))}>test</div>
		</>
	);
};

export default Page;
